import React from 'react'
import styled from 'styled-components';

const Text = styled.span`
  font-size : 20px;
  padding: 0 20px 0 20px;
`;

function MyPage1() {
    return (
        <>
            <Text>
                이름 <br /><br />
                핸드폰 <br /><br />
                이메일 <br /><br />
            </Text>
        </>
    )
}

export default MyPage1
